Â Hello, BTS. We hope that you will always be fine and that your coming days will be more beautiful. We, the Arabs, we love you so much. We hope you know that there are many Arab Armenians who love you and wish to meet you and wish you beautiful days and lasting happiness. Thank you for your love and for supporting us with courage, strength, motivation and teaching us thatÂ  Do not lose hope and make your effort to put a smile on our faces. We are proud of being your army. From the many we loved you, we cannot express what is inside us towards you. We love you, we love you so much.
